import React from 'react';

import { GoogleOutlined } from '@ant-design/icons';


const Login = () => {
    return (
        <div id="login-page">
            <div id="login-card">
                <h2>Welcome To FireChat!</h2>

                <div
                    className="login-button google"
                >

                </div>
            </div>
        </div>
    );
}

export default Login;
